import {Component} from 'react'


class Index extends Component {

    constructor(props) {
        super(props);

    }



    render() {

        return (
            <div className="d-flex justify-content-between " style={{width:'100%', backgroundColor: "white"}}>

                <div>Image</div>

                <div>
                    Dashboard, Schedule, Analytis

                </div>

            </div>
        );

    }
} 

export default Index;
